# <p><span class="hljs-comment">Import the MLBScraper class from the
#         game_scraper module</span></p>
from game_scraper import MLBScraper
# <p><span class="hljs-comment"># Define a list of URLs to scrape data
#         from</span></p>
urls = ['https://www.baseball-reference.com/leagues/majors/2021-schedule.shtml',
        'https://www.baseball-reference.com/leagues/majors/2022-schedule.shtml']
 # <p>Create a new instance of the MLBScraper class, and then call the scrape()
 #     method on the scraper object</p>
scraper = MLBScraper(urls)
df = scraper.scrape()
# <p>print the data frame to the console</p>
# <p><img
#         src="data:image/png;base64,">
# </p>
print(df)
# <p>Write the data from the DataFrame to a CSV file named mlb_stats_adv1.csv
# </p>
df.to_csv("mlb_stats_adv1.csv", index=False, encoding='utf-8')
